INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 7001, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 7002, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 7003, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 10001, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 10002, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 10003, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 10004, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 12001, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 13001, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 13002, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 13003, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 13004, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 14001, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 14002, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 14003, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 14004, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -470.0, 0.0, 0.0, "2030/12/17 14:59:59", 15001, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 16001, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 16002, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 16003, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 16004, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 17002, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 17004, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 17005, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 17006, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 17007, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 18001, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 18002, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -470.0, 0.0, 0.0, "2030/12/17 14:59:59", 19001, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -470.0, 0.0, 0.0, "2030/12/17 14:59:59", 19002, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -470.0, 0.0, 0.0, "2030/12/17 14:59:59", 20001, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -470.0, 0.0, 0.0, "2030/12/17 14:59:59", 20002, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 21001, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 21002, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 21003, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 21004, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -430.0, 0.0, 0.0, "2030/12/17 14:59:59", 22001, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -430.0, 0.0, 0.0, "2030/12/17 14:59:59", 22002, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -430.0, 0.0, 0.0, "2030/12/17 14:59:59", 23001, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -430.0, 0.0, 0.0, "2030/12/17 14:59:59", 23002, 1, 0, "カリン", "2015/12/17 15:00:00", 0, 190801, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 4.08, "2030/12/17 14:59:59", 24001, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 5.0, "2030/12/17 14:59:59", 24002, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109001, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 10.11, "2030/12/17 14:59:59", 24003, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109001, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 4.0, "2030/12/17 14:59:59", 24004, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109001, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 6.0, "2030/12/17 14:59:59", 24005, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109001, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24006, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109002, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24007, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109002, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 7);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24008, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109002, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 8);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24009, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109002, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 9);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24010, 1, 10011, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 0, 109002, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 10);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 2.12, "2030/12/17 14:59:59", 24011, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109101, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 4.19, "2030/12/17 14:59:59", 24012, 5, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109101, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, -385.0, 8.0, 2.3, "2030/12/17 14:59:59", 24013, 2, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109101, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24014, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109102, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 4);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 5.23, "2030/12/17 14:59:59", 24015, 5, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109101, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 5);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24016, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109102, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -385.0, 8.0, 5.01, "2030/12/17 14:59:59", 24017, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109101, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 7);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24018, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109102, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 8);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24019, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109102, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 9);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 0.0, 0.0, 0.0, "2030/12/17 14:59:59", 24020, 1, 10011, "シズル（バレンタイン）", "2019/01/31 12:00:00", 0, 109102, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 10);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 26001, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 26002, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 26003, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 26004, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 27001, 2, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 27002, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 27003, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 27004, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 27, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 28001, 1, 0, "カリン", "2019/09/24 15:00:00", 0, 190801, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 28002, 1, 0, "カリン", "2019/09/24 15:00:00", 0, 190801, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 28, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -409.0, 0.0, 0.0, "2030/12/17 14:59:59", 29001, 1, 0, "カリン", "2019/09/24 15:00:00", 0, 190801, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 29, 3);
