INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -409.0, 0.0, 0.0, "2030/12/17 14:59:59", 30002, 1, 0, "カリン", "2019/09/24 15:00:00", 0, 190801, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 30, 6);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -409.0, 0.0, 0.0, "2030/12/17 14:59:59", 31001, 1, 0, "カリン", "2019/10/31 12:00:00", 0, 190801, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 31, 7);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -409.0, 0.0, 0.0, "2030/12/17 14:59:59", 31002, 1, 0, "カリン", "2019/10/31 12:00:00", 0, 190801, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 31, 8);
