INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -409.0, 0.0, 0.0, "2020/01/04 4:59:59", 33002, 1, 0, "カリン", "2019/12/20 5:00:00", 0, 190801, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33, 4);
