INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 41003, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 41004, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 42001, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 42002, 1, 0, "シェフィ", "2015/12/17 15:00:00", 2104010, 106401, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 42003, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42, 1);
