INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 43001, 1, 0, "ペコリーヌ", "2015/12/17 15:00:00", 0, 105801, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 43002, 1, 0, "コッコロ", "2015/12/17 15:00:00", 0, 105901, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -363.0, 0.0, 0.0, "2030/12/17 14:59:59", 43003, 1, 0, "キャル", "2015/12/17 15:00:00", 0, 106001, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 43004, 1, 0, "アメス", "2015/12/17 15:00:00", 0, 123001, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 44, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 43005, 1, 0, "アメス", "2015/12/17 15:00:00", 0, 123001, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 2);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -416.5, 0.0, 5.79, "2030/12/17 14:59:59", 43006, 1, 0, "アメス", "2015/12/17 15:00:00", 0, 123001, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 3);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, -371.5, 0.0, 0.0, "2030/12/17 14:59:59", 46001, 1, 0, "アメス", "2015/12/17 15:00:00", 0, 123001, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -416.5, 0.0, 0.0, "2030/12/17 14:59:59", 47001, 2, 0, "シズル", "2015/12/17 15:00:00", 0, 104901, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47, 1);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, -416.5, 0.0, 9.32, "2030/12/17 14:59:59", 47002, 1, 0, "リノ", "2015/12/17 15:00:00", 0, 101101, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47, 1);
